import React from 'react';
import list from './list';

class App extends React.Component {

   state = {
       list:list,
   } 




    render () {
        return (

            <div className="App">

               <form>
                   <input type = "text"/>

               </form>
                {this.state.list.map(x=>
                     <div>{x.author}</div>

            )}
            </div>
        )
    }

}

export default App;
